import React from "react";

const Spinner = () => {
  return (
    <center
      class="spinner-border text-warning d-flex justify-content-center align-items-center spn"
      role="status"
    >
      <span class="visually-hidden">Loading...</span>
    </center>
  );
};

export default Spinner;
